import { useState } from "react";

const Home = () => {
    const [blogs, setBlogs] = useState([
        {title: 'Aqeeda', body: 'Wasitwiya', author: 'Ibn Taimiyah', id: 1},
        { title: 'Tafseer', body: 'Tafseer  Quraan Al Hakeem', author: 'Ibn Katheer', id: 2 },
        { title: 'Hadeeth', body: 'Saheeh', author: 'Bukhary and Muslim', id: 3 },
        { title: 'Fiqh', body: 'Mughny', author: 'Ibn Qudamah', id: 4 },

    ]);
    return (
        <div className="home">
        {blogs.map((blog) => (
            <div className="blog-preview" key={blog.id} >
                <h2> {blog.title} </h2>
<p> Writen byt { blog.author }</p>
            </div>
        ))};
        </div>

    );
}

export default Home;
